INSERT INTO `book` VALUES (1,'Blessing in Disguise','Now, one book can help you master mobile app development with both market-leading platforms: Apple\'s iOS and Google\'s Android. Perfect for both students and professionals, Learning Mobile App Development is the only tutorial with complete parallel coverage of both iOS and Android. With this guide, you can master either platform, or both - and gain a deeper understanding of the issues associated with developing mobile apps.\r\n\r\nYou\'ll develop an actual working app on both iOS and Android, mastering the entire mobile app development lifecycle, from planning through licensing and distribution.\r\n\r\nEach tutorial in this book has been carefully designed to support readers with widely varying backgrounds and has been extensively tested in live developer training courses. If you\'re new to iOS, you\'ll also find an easy, practical introduction to Objective-C, Apple\'s native language.',2007,200,21.00,18.99,100,2,2,'author-month-book-1.png','2019-11-26 00:59:03','2019-11-17 10:01:45',1,2),(2,'Silent Night','Doing Good by Doing Good shows companies how to improve the bottom line by implementing an engaging, authentic, and business-enhancing program that helps staff and business thrive. International CSR consultant Peter Baines draws upon lessons learnt from the challenges faced in his career as a police officer, forensic investigator, and founder of Hands Across the Water to describe the Australian CSR landscape, and the factors that make up a program that benefits everyone involved. Case studies illustrate the real effect of CSR on both business and society, with clear guidance toward maximizing involvement, engaging all employees, and improving the bottom line. The case studies draw out the companies that are focusing on creating shared value in meeting the challenges of society whilst at the same time bringing strong economic returns.\r\n\r\nConsumers are now expecting that big businesses with ever-increasing profits give back to the community from which those profits arise. At the same time, shareholders are demanding their share and are happy to see dividends soar. Getting this right is a balancing act, and Doing Good by Doing Good helps companies delineate a plan of action for getting it done.',2000,300,20.00,16.99,10,2,1,'author-month-book-2.jpg','2019-11-26 00:59:24','2019-11-17 10:01:45',2,2),(3,'Lost and Found','Dolorem laborum voluptas dolor temporibus dolor. Ut ea dicta quisquam voluptates ab delectus sapiente. Itaque aut ratione inventore ut hic nihil veniam.',1980,672,8.83,6.99,0,10,6,'author-month-book-3.jpg','2019-11-26 00:59:35','2019-11-17 10:01:45',3,2),(5,'A Brief History of Time','Nesciunt reprehenderit iste consequatur et quaerat. Rem quo officiis ut veritatis illo rerum dolorum. Asperiores aut et a sint voluptas in qui modi.',2000,444,5.95,4.32,0,8,3,'bestsell-2.jpg','2019-11-26 01:00:08','2019-11-17 10:01:45',5,2),(6,'Eat Fat Get Thin','Omnis incidunt cumque accusantium et pariatur. Eum iure consequatur velit. Culpa non vitae expedita eligendi eum totam.',1998,294,29.52,27.5,0,8,6,'bestsell-3.jpg','2019-11-25 13:48:36','2019-11-17 10:01:45',6,6),(7,'Say Nothing','Similique id in omnis. Placeat quo voluptates illum vitae. Sint laudantium at at repellat aut necessitatibus aut. Magnam commodi enim nesciunt error.',1994,591,9.17,7.19,0,7,1,'bestsell-4.jpg','2019-11-25 13:48:49','2019-11-17 10:01:45',7,5),(8,'The Friend','Ad occaecati molestias laudantium. Enim laboriosam quos architecto consequatur molestiae. Mollitia aut et alias veniam. Voluptate incidunt est excepturi iure a et.',1994,641,11.95,9.15,0,8,7,'bestsell-5.jpg','2019-11-25 13:49:04','2019-11-17 10:01:45',8,4),(10,'Fugiat est doloremque commodi non architecto.','Ex quaerat itaque beatae nobis itaque. Ut vitae explicabo temporibus tempora similique ut dolorem. In omnis quia officiis incidunt molestias fugit animi.',2017,499,18.76,0,0,9,4,'bestsell-7.jpg','2019-11-24 13:53:34','2019-11-17 10:01